fields.formula:
concat( 
  "S", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

if( 
  or( 
    field("Discount (%)") < 0.01, 
    isblank(field("Discount (%)")) 
  ), 
  sum( 
    lookup("Services executed", "Cost") 
  ), 
  multiply( 
    sum( 
      lookup("Services executed", "Cost") 
    ),  
    divide( 
      minus( 
        100, 
        field("Discount (%)") 
      ), 
      100 
    ) 
  ) 
)

totext(  
  join( 
    if( 
      field("Customer") = totext(lookup("Vehicle ID", "Owner")), 
      "match found", 
      "not" 
    ), 
    "" 
  ) 
)

if( 
  or( 
    field("Discount (%)") < 0.01, 
    isblank(field("Discount (%)")) 
  ), 
  multiply( 
    field("Quantity"), 
    field("Price") 
  ), 
  multiply( 
    multiply( 
      field("Quantity"), 
      field("Price") 
    ),  
    divide( 
      minus( 
        100, 
        field("Discount (%)") 
      ), 
      100 
    ) 
  ) 
)

concat( 
  "X", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

count( 
  filter( 
    lookup("Related service logs", "Status"), 
    totext(lookup("Related service logs", "Status")) != "Released" 
  ) 
)

add( 
  count( 
    filter( 
      lookup("Supervised services", "Status"), 
      totext(lookup("Supervised services", "Status")) != "Released" 
    ) 
  ), 
  count( 
    filter( 
      lookup("Related service logs", "Status"), 
      totext(lookup("Related service logs", "Status")) != "Released" 
    ) 
  ) 
)
